import React from "react";
import "./Home.css";
import { Container, Row, Col } from "react-bootstrap";
import Role from "./Role";
import Links from "./Links";
import ProfileImage from "../../Assets/profile-image.jpg";
import DownArrow from "../../Assets/circle-down-solid.svg";
import Ray from "../../Assets/ray.png";
import FightOn from "../../Assets/fight-on.png";
import Overview from "./Overview";


export default function Home() {
  return (
    <section id="home">
      <div className="ray"><img src={Ray} alt="ray"/></div>
      {/* <div className="fightOn"><img src={FightOn} alt="fight-on"/></div> */}
      <Container className="home-content">
        <Row>
          <Col md={1} />
          <Col md={7} className="home-header">
            <h3 className="home-greeting">
              Greetings! i'm
            </h3>
            <p><span className="home-name"> ENYAN (EVELYN) XIA </span></p>
            <Role className="role"/>
            <hr></hr>
            <Links className="icons"/>
          </Col>
          <Col md={3}>
            <img src={ProfileImage} alt="profile" className="home-image"/>
          </Col>
        </Row>
        <Row><img src={DownArrow} alt="arrow" className="home-arrow"/></Row>
        <Overview/>
      </Container>
    </section>
  );
}
